['#include<bits/stdc++.h>
using namespace std;

#define int long long int
#define fi first
#define se second
#define pb push_back
#define mp make_pair
#define all(a) (a).begin(),(a).end()
#define lb lower_bound
#define ub upper_bound
#define srt(a) sort(a.begin(),a.end())
typedef vector<int> vi;
typedef vector<vi> vvi;
typedef pair<int,int> pii;
#define mxe(a) *max_element(a.begin(),a.end())
#define mne(a) *min_element(a.begin(),a.end())
#define endl '\n'
#define INF 1000000007
#define mod 998244353
#define INF64 1e18

/*template<int D, typename T>
struct Vec : public vector<Vec<D - 1, T>> {
  static_assert(D >= 1, "Vector dimension must be greater than zero!");
  template<typename... Args>
  Vec(int n = 0, Args... args) : vector<Vec<D - 1, T>>(n, Vec<D - 1, T>(args...)) {
  }
};
template<typename T>
struct Vec<1, T> : public vector<T> {
  Vec(int n = 0, const T& val = T()) : vector<T>(n, val) {
  }
};*/
/*ll power(ll a,ll b){
  ll res=1;
  while(b>0){
    if(b&1)(res*=a)%=mod;
    (a*=a)%=mod;
    b>>=1;
  }
  return res;
}*/

void solve(){
  int n,x,y;cin>>n>>x>>y;
  vi a(n);
  for(int i=0;i<n;i++)
    cin>>a[i];
  
  int i;
  for(i=x;i<n-y;i++){
    bool f=1;
    for(int j=1;j<=x;j++)
      if(a[i]>=a[i-j]){f=0;break;}
    if(f){
      for(int j=1;j<=y;j++)
        if(a[i]>=a[i+j]){f=0;break;}
    }
    if(!f)
      continue;
    else break;
  }
  if(i==n){
    bool f=1;
    for(int i=1;i<=y;i++)
      if(a[0]>=a[i]){f=0;break;}
    
      cout<<f?1:n;
  }
  else cout<<i+1;

}

int32_t main(){
  #ifndef ONLINE_JUDGE
   freopen("input.txt","r",stdin);
   freopen("output.txt","w",stdout);
  #endif
  
  ios_base::sync_with_stdio(false);
  cin.tie(0);cout.tie(0);

  int T;
  //cin>>T;
  T=1;
  while(T--){
    solve();
  }
}']

['#include<bits/stdc++.h>
using namespace std;
#define int long long
int z[100005];
signed main()
{
	ios_base::sync_with_stdio(0), cin.tie(0), cout.tie(0);
	int n; cin >> n; int x, y; cin >> x >> y;
	for (int i = 1; i <= n; ++i)
	{
		cin >> z[i];
	}
	for (int i = 1; i <= n; ++i)
	{
		int fl = 0;
		for (int j = i - x; j <=i+y; ++j)
		{
			if (j >= 1 && j <= n)
			{
				if (z[j] < z[i])
				{
					fl = 1;
					break;
				}
			}
		}
		if (fl == 0) { cout << i << endl; break; }
	}
}']
